(1, '<section Id=\"who-we-are\" Class=\"section M-t-0\">\r\n<h2 Style=\"text-align: Left;\">Siapa Kami ?</h2>\r\n<p Style=\"text-align: Justify;\"><span Style=\"font-size: 12pt;\">Kami Adalah Perusahaan Yang Sedang Berkembang Yang Mengelola Situs Ecommerce Zafpedia.com. Perusahaan Kami Didirikan Pada Tahun 2019 Dan Masih Beroperasi Hingga Saat Ini. </span><span Style=\"font-size: 12pt;\">Di Bawah Naungan Zaf Media Group Kami Mengelola Situs Ini Dan Memberikan Pelayanan Jual Beli Produk Kepada Customer Kami. Target Penjualan Kami Adalah Sampai Ke Pasar Nasional Dengan Produk Yang Dijual Dengan Harga Yang Terjangkau.</span></p>\r\n<p Style=\"text-align: Justify;\">&nbsp;</p>\r\n</section>', 'Zafpedia.com Menjual Berbagai Macam Produk Umkm, Elektronik Maupun Produk Lainnya. Zafpedia.com Juga Bekerja Sama Dengan Mitra Seller Dan Reseller Kami Dari Berbagai Daerah.', 'about-3006.jpg', 'Pengiriman Mudah', 'Dukungan 24/7', 'Kualitas Terbaik', 'Dengan fitur ongkos kirim otomatis yang dihitung berdasarkan lokasi pembeli akan lebih mudah dan mempercepat pelayanan pengiriman sampau ke tempat customer, karena customer sendiri yang akan memilih jasa dan layanan ekspedisi.', 'Tim kami akan melayani pembeli dan memberikan pelayanan teknis 24 jam.\r\nJadi customer akan merasa terbantu dengan pelayanan dari kami.', 'Produk yang kami jual dijamin merupakan produk unggulan dengan kualitas terbaik.');
