INSERT INTO `faq` (`id`, `pertanyaan`, `jawaban`, `collapse`, `tgl_update`) VALUES
(3, 'Cari Produk Keinginan Anda ?', '<p>Halo calon pembeli di Toko Zafpedia.com.</p>\r\n<p>Berikut cara mencari produk yang anda inginkan di situs ini.</p>\r\n<ol>\r\n<li>&nbsp;Ketikkan kata kunci pada text box yang berada pada halaman paling atas situs ini.</li>\r\n<li>Klik tombol cari yang berada disebelahnya berupa gambar kaca pembesar.</li>\r\n<li>Tunggu sampai ketemu produk berdasarkan kata kunci yang anda masukkan</li>\r\n</ol>', 'collapse1', '2019-04-16'),
(4, 'Cara Pemesanan Produk Pada Situs Ini ?', '<p>Halo calon pembeli yang akan memesan produk pada situs ini .</p>\r\n<p>Berikut langkah-langkahnya :</p>\r\n<ol>\r\n<li>&nbsp;Cari produk yang akan anda inginkan terlebih dahulu.</li>\r\n<li>Klik tautan judul produk atau tombol add to cart yang muncul pada bawah harga.</li>\r\n<li>Anda akan diarahkan ke halaman detail produk.</li>\r\n<li>Pilih quantity produk yang anda inginkan.</li>\r\n<li>Klik tombol add to cart pada sebelah quantity.</li>\r\n<li>Pesanan anda akan masuk ke keranjang belanja yang berada pada halaman atas situs ini.</li>\r\n</ol>', 'collapse4', '2019-04-16'),
(5, 'Cara Memproses Pesanan Di Shopping Cart ?', '<p>Halo calon pembeli yang akan melakukan pemrosesan pada menu shopping cart.</p>\r\n<p>Berikut langkah langkahnya.</p>\r\n<ol>\r\n<li>&nbsp;Masuk ke menu shopping cart yang berada pada header situs ini.</li>\r\n<li>&nbsp;Jika sudah masuk ke menu shopping cart, langsung klik tombol checkout yang berada pada menu tersebut.</li>\r\n<li>Anda akan di arahkan ke halaman checkout</li>\r\n<li>Anda diharuskan untuk mengisi formulir yang tersedia pada menu tersebut sesuai dengan identitas diri anda yang valid.</li>\r\n<li>Ikuti langkah demi langkah sampai selesai pada tombol submit pesanan.</li>\r\n<li>Pesanan anda akan masuk ke sistem kami.</li>\r\n<li>Anda akan mendapatkan email invoice dari kami.</li>\r\n<li>&nbsp;Lakukan pembayaran sesuai dengan pilihan rekening dan total pembelian yang sudah kami kirimkan ke email anda.</li>\r\n</ol>', 'collapse5', '2019-04-16'),
(6, 'Cara Menambah Jumlah Barang ?', '<p>Halo calon pembeli yang akan menambah jumlah pesanan .</p>\r\n<p>Berikut langkah langkahnya :</p>\r\n<ol>\r\n<li>&nbsp;Masuk ke menu shopping cart</li>\r\n<li>Ubah Quantity yang anda inginkan.</li>\r\n<li>Tekan tombol update setelah selesai mengubah quantity yang anda inginkan.</li>\r\n<li>Selesai</li>\r\n</ol>', 'collapse6', '2019-04-16');
