(3, 'Privacy Policy', '0', 'privacy-policy', '<p style=\"text-align: justify;\"><code></code></p>\r\n<h1 style=\"text-align: justify;\">Privacy Policy for zafpedia.com</h1>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">If you require any more information or have any questions about our privacy policy, please feel free to contact us by email at <a href=\"mailto:info@zafpedia.com\">privacy-policy</a>.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">At http://zafpedia.com we consider the privacy of our visitors to be extremely important. This privacy policy document describes in detail the types of personal information is collected and recorded by http://zafpedia.com and how we use it.</p>\r\n<p style=\"text-align: justify;\"><strong>Log Files</strong><br /> Like many other Web sites, http://zafpedia.com makes use of log files. These files merely logs visitors to the site - usually a standard procedure for hosting companies and a part of hosting services\'s analytics. The information inside the log files includes internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date/time stamp, referring/exit pages, and possibly the number of clicks. This information is used to analyze trends, administer the site, track user\'s movement around the site, and gather demographic information. IP addresses, and other such information are not linked to any information that is personally identifiable.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Cookies and Web Beacons</strong><br />http://zafpedia.com uses cookies to store information about visitors\' preferences, to record user-specific information on which pages the site visitor accesses or visits, and to personalize or customize our web page content based upon visitors\' browser type or other information that the visitor sends via their browser.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>DoubleClick DART Cookie</strong><br /> <br /> <br />&rarr; Google, as a third party vendor, uses cookies to serve ads on http://zafpedia.com.<br /> <br />&rarr; Google\'s use of the DART cookie enables it to serve ads to our site\'s visitors based upon their visit to http://zafpedia.com and other sites on the Internet. <br /> <br />&rarr; Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy at the following URL - <a title=\"Opt out of the Dart Cookie\" href=\"http://www.google.com/privacy_ads.html\">http://www.google.com/privacy_ads.html</a></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Our Advertising Partners</strong><br /> <br /> Some of our advertising partners may use cookies and web beacons on our site. Our advertising partners include ....... <br /><br /></p>\r\n<ul style=\"text-align: justify;\">\r\n<ul>\r\n<li>Google</li>\r\n</ul>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><em>While each of these advertising partners has their own Privacy Policy for their site, an updated and hyperlinked resource is maintained here: <a href=\"http://www.privacypolicyonline.com/privacy-policies\">Privacy Policies</a>.<br /> <br />You may consult this listing to find the privacy policy for each of the advertising partners of http://zafpedia.com.</em></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">These third-party ad servers or ad networks use technology in their respective advertisements and links that appear on http://zafpedia.com and which are sent directly to your browser. They automatically receive your IP address when this occurs. Other technologies (such as cookies, JavaScript, or Web Beacons) may also be used by our site\'s third-party ad networks to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on the site.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">http://zafpedia.com has no access to or control over these cookies that are used by third-party advertisers.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Third Party Privacy Policies</strong><br /> <br />You should consult the respective privacy policies of these third-party ad servers for more detailed information on their practices as well as for instructions about how to opt-out of certain practices. http://zafpedia.com\'s privacy policy does not apply to, and we cannot control the activities of, such other advertisers or web sites. You may find a comprehensive listing of these privacy policies and their links here: <a title=\"Privacy Policy Links\" href=\"http://www.privacypolicyonline.com/privacy-policy-links\">Privacy Policy Links</a>.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">If you wish to disable cookies, you may do so through your individual browser options. More detailed information about cookie management with specific web browsers can be found at the browsers\' respective websites. <a href=\"http://www.privacypolicyonline.com/what-are-cookies\">What Are Cookies?</a></p>\r\n<p style=\"text-align: justify;\"><code></code></p>\r\n<p style=\"text-align: justify;\"><strong>Children\'s Information</strong><br />We believe it is important to provide added protection for children online. We encourage parents and guardians to spend time online with their children to observe, participate in and/or monitor and guide their online activity.<br />http://zafpedia.com does not knowingly collect any personally identifiable information from children under the age of 13. If a parent or guardian believes that http://zafpedia.com has in its database the personally-identifiable information of a child under the age of 13, please contact us immediately (using the contact in the first paragraph) and we will use our best efforts to promptly remove such information from our records.</p>\r\n<p style=\"text-align: justify;\"><code></code></p>\r\n<p style=\"text-align: justify;\"><br /><strong>Online Privacy Policy Only</strong><br /><br />This privacy policy applies only to our online activities and is valid for visitors to our website and regarding information shared and/or collected there.<br />This policy does not apply to any information collected offline or via channels other than this website.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Consent</strong><br /><br />By using our website, you hereby consent to our privacy policy and agree to its terms.</p>\r\n<p style=\"text-align: justify;\"><br /><br /></p>\r\n<p style=\"text-align: justify;\"><strong>Update</strong><br />This Privacy Policy was last updated on: Sunday, April 14th, 2019.<br /><a title=\"PrivacyPolicyOnline.com Approved Site\" href=\"http://www.PrivacyPolicyOnline.com\" target=\"_blank\" rel=\"noopener\"><img src=\"http://www.privacypolicyonline.com/images/privacypolicyonline-seal.png\" alt=\"Privacy Policy Online Approved Site\" align=\"right\" border=\"0\" /></a><br /><em>Should we update, amend or make any changes to our privacy policy, those changes will be posted here.</em><br /><br /><br /></p>\r\n<p style=\"text-align: justify;\"><br /><!-- END of Privacy Policy || Generated by http://www.PrivacyPolicyOnline.com || --></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '1', 0, 'page_with_sidebar'),
