(47, 'BAR-0071', 'Kue Bola Salju / Putri Salju kemasan 500 Gram', 'kue-bola-salju-putri-salju-kemasan-500-gram', '<p>Kue kering Putri salju / Bola Salju ukuran 500 Gram.</p>\r\n<p>&nbsp;</p>\r\n<p>Tersedia juga Paket Hemat isi 4 Toples 4 Macam Kue</p>\r\n<p>Paket Hemat Untuk Kue :</p>\r\n<ul>\r\n<li>Kastengel</li>\r\n<li>Putri Salju</li>\r\n<li>Nastar</li>\r\n<li>Chocochip</li>\r\n</ul>', 'Kue kering Putri salju / Bola Salju ukuran 500 Gram.', 26, 34000, 0, 100, '1', '0', '1', 'Kue kering Putri salju / Bola Salju ukuran 500 Gram.', 'putri salju, bola salju, kue , kue lebaran', '12', 'prod-5a24.jpg', 0, 1000, '2019-05-06 16:35:46', 220),
(48, 'BAR-0068', 'Kue Kering Semprit Cokelat kemasan 500 Gram', 'kue-kering-semprit-cokelat-kemasan-500-gram', '<p>Kue kering semprit cokelat&nbsp; 500 Gram&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Tersedia juga dalam paket hemat isi 4 Toples = 4 Macam kue</p>\r\n<ul>\r\n<li>nastar</li>\r\n<li>kastengel</li>\r\n<li>chocochips</li>\r\n<li>putri salju</li>\r\n</ul>\r\n<p>&nbsp;</p>', 'Kue kering semprit cokelat kemasan 500 Gram \r\n', 26, 27000, 0, 99, '0', '0', '1', 'Kue kering kemasan 500 Gram \r\n', 'kue kering, chochocips,kue lebaran', '12', 'prod-579c.jpg', 0, 1000, '2019-05-06 16:38:41', 117),
(49, 'BAR-0057', 'ANDROGRAPHIS CENTELLA', 'andrographis-centella', '<p>ANDROGRAPHIS CENTELLA</p>\r\n<p style=\"text-align: justify;\"><a href=\"https://zafpedia.com/\">Andrographis Centella</a> mengandung EKSTRAK sambiloto (andrographis paniculata), ekstrak ilalang (imperata cylindrica) dan ekstrak pegagan (centella asiatica). Andrographis Centella berperan sebagai pelindung lever (hepato-protector) terbaik. Bermanfaat meningkatkan sistem kekebalan tubuh, menurunkan panas (bersifat diuretik), analgesik alami (penghilang rasa nyeri) dan antibiotik alami.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<p style=\"text-align: justify;\">Isi : 75 Kapsul</p>\r\n<p style=\"text-align: justify;\">Manfaat &amp; Kegunaan</p>\r\n<p style=\"text-align: justify;\">SAMBILOTO (Andrographis Paniculata): Untuk mengatasi/mengobati typhus abdominalis, disentri basiler (diare), flu, sakit kepala, panas, influenza, radang paru, radang saluran nafas, TBC paru, batuk rejan, darah tinggi, infeksi mulut, tonsilitis, pharyngitis, kencing manis, kudis, disentri, kencing nanah, kanker, demam, infeksi telinga tengah (OMA), luka bakar, digigit ular berbisa, membangkitkan nafsu makan. KHASIAT ILALANG (Imperata Cylindrica): Untuk mengatasi/mengobati muntah darah, mimisan, air kemih berdarah, kencing nanah, hepatitis, radang ginjal, rasa haus pada campak. KHASIAT PEGAGAN (Cantella Asiatica): Untuk mengatasi/mengobati infeksi saluran kencing, bisul, panas, ayan, busung, pembengkakan hati, campak, darah tinggi, wasir, typhus, lepra, batuk darah, muntah darah, batuk asthma, batuk kering, demam, radang amandel, sakit tenggorokan, bronchitis, sakit kepala, sakit perut, cacingan, menambah nafsu makan, mata merah, bengkak.</p>', 'Andrographis Centella mengandung EKSTRAK sambiloto (andrographis paniculata), ekstrak ilalang (imperata cylindrica) dan ekstrak pegagan (centella asiatica). Andrographis Centella berperan sebagai pelindung lever (hepato-protector) terbaik. Bermanfaat meningkatkan sistem kekebalan tubuh, menurunkan panas (bersifat diuretik), analgesik alami (penghilang rasa nyeri) dan antibiotik alami.', 53, 70000, 0, 20, '0', '1', '1', 'Andrographis Centella mengandung EKSTRAK sambiloto (andrographis paniculata), ekstrak ilalang (imperata cylindrica) dan ekstrak pegagan (centella asiatica).', 'Andrographis Centella , EKSTRAK sambiloto, ekstrak ilalang  dan ekstrak pegagan (centella asiatica), HPAI,HNI, obat herbal,', '', 'prod-830f.jpg', 0, 1000, '2019-05-14 04:34:18', 100),
(50, 'BAR-0058', 'BIOSIR', 'biosir', '<p style=\"text-align: justify;\"><strong>BIOSIR</strong></p>\r\n<p style=\"text-align: justify;\">Wasir adalah penyakit yang disebabkan karena pembesaran atau pembengkakan pembuluh darah vena pada selaput lendir dubur atau pada kulit di sekitarnya.<br /> Wasir sering mengakibatkan pendarahan saat buang air besar.</p>\r\n<p style=\"text-align: justify;\">Biosir dapat mengatasi masalah wasir dan gejalanya. Biosir menggunakan herba-herba yang memiliki efek farmakologi sebagai laksatif/pencahar untuk memperlancar buang air besar.</p>\r\n<p style=\"text-align: justify;\"><strong>Prinsip Mengobati Wasir adalah :</strong></p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Mempermudah BAB, untuk itu diperlukan obat sebagai anti sembelit atau pencahar.</li>\r\n<li>Mengobati luka, radang, atau inveksi yang terjadi akibat pendarahan</li>\r\n<li>Harus menghambat pembengkakan yang mungkin terhadi</li>\r\n<li>Antibiotik sangat penting untuk mengatasi inveksi</li>\r\n<li>Meregenerasi sel untuk mengembalikan fungsi oran tubuh</li>\r\n<li>Meningkatkan kekebalan tubuh</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Untuk itu, hadirlah Biosir yang merupakan sinergi dari herbal-herbal yang berkhasiat seperti disebutkan diatas.</p>\r\n<p style=\"text-align: justify;\"><strong>Kandungan Biosir HPAI</strong></p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Graptophylli folium (pencahar ringan atau anti sembelit)</li>\r\n<li>Curcumae rhizoma (menjaga fungsi hati untuk meningkatkan metabolisme tubuh, juga anti radang, dan mengurangi rasa sakit)</li>\r\n<li>Centellae herba (Anti infeksi, penurun panas, peluruh air seni, regenerasi sel dan memperbaiki sirkulasi dengan revitalisasi pembuluh darah (mempertinggi permeabilitas kapiler), tonikum dan astringen (memperbaiki fungsi membran dan mengikat molekul-molekul protein untuk mengurangi iritasi dan peradangan serta pertahanan terhadap infeksi).</li>\r\n<li>Andrographidis herba (Anti hiperglikemia (menurunkan kadar gula darah), meningkatkan aktifitas kelenjar-kelenjar tubuh, hepatoprotektif (menjaga fungsi hati), antibiotik, pereda panas, anti radang, menghambat pembengkakan, pereda nyeri dan peluruh air seni serta meningkatkan kekebalan tubuh seluler).</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><strong>Manfaat &amp; Kegunaan Biosir HPAI</strong></p>\r\n<ul>\r\n<li style=\"text-align: justify;\">&nbsp;Anti sembelit, anti radang, menghambat pembengkakan, tonikum (penambah tenaga), anti bakteri dan jamur serta sebagai peluruh getah empedu dan menjaga fungsi hati sehingga metabolisme tubuh dapat berjalan sempurna.</li>\r\n<li style=\"text-align: justify;\">Anti infeksi, penurun panas, peluruh air seni, regenerasi sel dan memperbaiki sirkulasi dengan revitalisasi pembuluh darah (mempertinggi permeabilitas kapiler)</li>\r\n<li style=\"text-align: justify;\">&nbsp;Antibiotik, pereda panas, pereda nyeri dan meningkatkan kekebalan tubuh seluler</li>\r\n</ul>', 'Prinsip Mengobati Wasir adalah :\r\n\r\nMempermudah BAB, untuk itu diperlukan obat sebagai anti sembelit atau pencahar.\r\nMengobati luka, radang, atau inveksi yang terjadi akibat pendarahan\r\nHarus menghambat pembengkakan yang mungkin terhadi\r\nAntibiotik sangat penting untuk mengatasi inveksi\r\nMeregenerasi sel untuk mengembalikan fungsi oran tubuh\r\nMeningkatkan kekebalan tubuh', 53, 90000, 0, 8, '1', '', '1', 'Biosir dapat mengatasi masalah wasir dan gejalanya. Biosir menggunakan herba-herba yang memiliki efek farmakologi sebagai laksatif/pencahar untuk memperlancar buang air besar.', 'BIOSIR, HPAI, OBAT HERBAL, RAMUAN HERBAL, AGEN HPAI, DUNIA HALAL', '', 'prod-9481.jpg', 0, 1000, '2019-05-14 05:10:53', 160),
(51, 'BAR-0060', 'CARNOCAP', 'carnocap', '<p style=\"text-align: justify;\">CARNOCAP</p>\r\n<p style=\"text-align: justify;\">Produk Carnocap HPAI merupakan obat herbal yang luar biasa manfaatnya yang digunakan secara tradisional untuk membantu menghambat&nbsp;dan mematikan sel-sel tumor dan kanker. Carnocap memiliki komposisi yang dapat menghambat perkembangan sel kanker dan mematikannya.</p>\r\n<p style=\"text-align: justify;\">Bagi Anda yang saat ini sedang mencari obat herbal kanker dan tumor, produk Carnocap HPAI menjadi pilihan yang tepat untuk Anda konsumsi sebagai obat herbal yang aman, halal dan berkualitas yang Insya Allah sudah terbukti khasiatnya apabila dengan tekun mengkonsumsinya dan mengikuti aturan minum. Disamping itu banyak manfaat lainnya selain yang paling utama sebagai obat kanker dan tumor.</p>\r\n<p style=\"text-align: justify;\"><strong>Manfaat Obat Herbal Carnocap HPAI</strong></p>\r\n<ul style=\"text-align: justify;\">\r\n<li>KELADI TIKUS : Membunuh / menghambat pertumbuhan sel kanker, menghilangkan efek buruk kemoterapi, bersifat anti virus dan anti bakteri.</li>\r\n<li>RUMPUT MUTIARA : Anti piretik, anti inflamasi, anti toksin, anti kanker, mengaktifkan sirkulasi darah.</li>\r\n<li>JOMBANG : Anti biotik, anti inflamasi, anti piretik, anti toksin, anti kanker dan tumor dan diuretik</li>\r\n<li>SAMBILOTO : Menurunkan panas, antibiotik, antipiretik, anti radang, anti bengkak, diuretik, anti bakteri, analgetik, meningkatkan kekebalan tubuh seluler dan meningkatkan aktifitas kelenjar-kelenjar tubuh.</li>\r\n<li>KUNIR PUTIH : Anti oksidan, anti inflamasi, anti neoplastik, anti koagulan.</li>\r\n<li>TEMU PUTIH : Anti inflamasi, melancarkan sirkulasi darah, anti neoplastik.</li>\r\n<li>DAUN DEWA : Antipiretik, anti koagulan, stimulasi sirkulasi, anti toksin, anti karsinogenik, anti mutagenik.</li>\r\n<li>BIDARA UPAS : inflamasi, analgesik, anti toksin.</li>\r\n<li>TAPAK DARA : Anti neoplastik, sitostatik, menghentikan pendarahan.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Banyak yang telah merasakan manfaat Carnocap HPAI sebagai penyembuh kanker, tumor dan penyakit sejenisnya dengan cara melemahkan bahkan mematikan sel kanker atau tumor. Buktikan sendiri khasiatnya, dengan penuh ketekunan dalam mengkonsumsinya disertai keyakinan akan sembuh sebagai ikhtiar Anda dalam berobat, namun tetap berkeyakinan bahwa Allah SWT yang menyembuhkan.</p>\r\n<p style=\"text-align: justify;\">Silakan bagi Anda yang ingin memesan segera produk Carnocap HPAI, kami menjual produk Carnocap HPAI asli dengan cara menghubungi kontak pesan yang ada di web ini. Insya Allah pesanan Anda akan terkirim ketempat tujuan dengan aman.</p>', 'Manfaat Obat Herbal Carnocap HPAI\r\n\r\nKELADI TIKUS : Membunuh / menghambat pertumbuhan sel kanker, menghilangkan efek buruk kemoterapi, bersifat anti virus dan anti bakteri.\r\nRUMPUT MUTIARA : Anti piretik, anti inflamasi, anti toksin, anti kanker, mengaktifkan sirkulasi darah.\r\nJOMBANG : Anti biotik, anti inflamasi, anti piretik, anti toksin, anti kanker dan tumor dan diuretik\r\nSAMBILOTO : Menurunkan panas, antibiotik, antipiretik, anti radang, anti bengkak, diuretik, anti bakteri, analgetik, meningkatkan kekebalan tubuh seluler dan meningkatkan aktifitas kelenjar-kelenjar tubuh.\r\nKUNIR PUTIH : Anti oksidan, anti inflamasi, anti neoplastik, anti koagulan.\r\nTEMU PUTIH : Anti inflamasi, melancarkan sirkulasi darah, anti neoplastik.\r\nDAUN DEWA : Antipiretik, anti koagulan, stimulasi sirkulasi, anti toksin, anti karsinogenik, anti mutagenik.\r\nBIDARA UPAS : inflamasi, analgesik, anti toksin.\r\nTAPAK DARA : Anti neoplastik, sitostatik, menghentikan pendarahan.', 53, 120000, 0, 10, '0', '', '1', 'Produk Carnocap HPAI merupakan obat herbal yang luar biasa manfaatnya yang digunakan secara tradisional untuk membantu menghambat dan mematikan sel-sel tumor dan kanker. ', 'HPAI, CARNOCAP, KANKER, TUMOR, OBAT HERBAL', '', 'prod-7011.jpg', 0, 1000, '2019-05-14 05:59:29', 94),
(52, 'BAR-0063', 'CENTELLA TEH SINERGI', 'centella-teh-sinergi', '<p><strong>CENTELLA TEH SINERGI</strong></p>\r\n<p>Khasiat : Teh celup herbal Centella Teh Sinergi berkhasiat untuk pembersih darah, melangsingkan tubuh, kesehatah jantung, ginjal cocok untuk promil PIRT No.2103275010127-19 Isi Kemasan : 24 sachet</p>', 'Khasiat : Teh celup herbal Centella Teh Sinergi berkhasiat untuk pembersih darah, melangsingkan tubuh, kesehatah jantung, ginjal cocok untuk promil PIRT No.2103275010127-19 Isi Kemasan : 24 sachet', 53, 70000, 0, 8, '', '1', '1', 'Centella teh sinergi Teh celup herbal Centella Teh Sinergi berkhasiat untuk pembersih darah, melangsingkan tubuh, kesehatah jantung, ginjal cocok untuk promil ', 'Teh sinergi, HPAI, HNI, Obat Herbal, Tanaman Herbal, Dunia Halal, ', '', 'prod-8933.jpg', 0, 1000, '2019-05-14 10:30:40', 103),
(53, 'BAR-0064', 'Day Cream HNI HPAI Merawat dan Melindungi Kulit', 'day-cream-hni-hpai-merawat-dan-melindungi-kulit', '<h3 style=\"text-align: justify;\"><strong>Day Cream HNI HPAI Merawat dan Melindungi Kulit</strong></h3>\r\n<p style=\"text-align: justify;\"><strong>Day Cream HNI HPAI Merawat dan Melindungi Kulit</strong>&nbsp;&ndash; Setiap wanita mendambakan kulitnya mulus dan sehat. Kebanyakan wanita akan merasa minder apabila pada kulit wajahnya timbul kerutan, flek hitam, dan terlihat kusam. Permasalahan kulit seperti demikian salah satunya diakibatkan kurangnya perawatan pada wajah dan tidak terlindungnya wajah dari paparan sinar matahari. Untuk itu salah satu solusi untuk merawat wajah agar sehat dan terjaga dari dampak sinar UV pada kulit adalah dengan menggunakan&nbsp;<em><strong>Day Cream</strong></em>.</p>\r\n<p style=\"text-align: justify;\">Day Cream HNI HPAI merupakan produk kosmetik untuk perawatan wajah dan kulit yang digunakan untuk siang hari. Day Cream HNI HPAI melindungi dan menangkal secara maksimal kulit wajah dari radiasi matahari sekaligus sebagai pelembab wajah.</p>\r\n<p style=\"text-align: justify;\">Day Cream HNI HPAI terbuat dari bahan-bahan alami sehingga aman untuk digunakan setiap hari terutama pada saat aktivitas siang hari. Agar lebih maksimal bisa dipadukan dengan Night Cream HNI HPAI pada malam harinya. Manfaat umum&nbsp;<strong>cream dan night cream&nbsp;</strong>adalah untuk menjaga kesehatan kulit dan mencegah kulit mengalami penuaan dini. Selengkapnya mengenai&nbsp;<a href=\"http://www.herbalismart.com/night-cream-hni-hpai/\">Night Cream HNI HPAI</a>&nbsp;bisa Anda&nbsp;<a href=\"http://www.herbalismart.com/night-cream-hni-hpai/\">baca disini</a>.</p>\r\n<p style=\"text-align: justify;\"><strong>Komposisi dan Manfaat Day Cream HNI HPAI</strong></p>\r\n<p style=\"text-align: justify;\">Day Cream HNI HPAI mengandung bahan-bahan alami yang sangat bermanfaat bagi perawatan wajah dan kulit pada waktu melakukan aktifitas di siang hari. Berikut ini adalah Supporting Material dalam Day Cream :</p>\r\n<ol style=\"text-align: justify;\">\r\n<li><strong>Sun Protection Factor (SPF)</strong>&nbsp;, menyaring dan menahan sinar UV dari matahari yang dapat menimbulkan radikal bebas pada kulit wajah sehingga terhindar dari efek efek penuaan dini.</li>\r\n<li><strong>Glycine Soja Seed Extract</strong>, merupakan ekstrak dari tanaman kedelai yang mempunyai fungsi sebagai collagen promoting agent dan melindungi epidermal stem cell yang berfungsi sebagai generating dan rejuvenating epidermis</li>\r\n<li><strong>Olive (Olea Europea) Oil</strong>&nbsp;, merupakan minyak yang diambil dari Zaitun, mempunyai fungsi sebagai emollient, yang memberikan efek lembut pada kulit.</li>\r\n<li><strong>Natural Extract Mixture</strong>&nbsp;yang mempunyai fungsi sebagai anti inflammatory effect, soothing agent, calming skin &amp; hydrating skin.</li>\r\n<li><strong>Aloe Barbadensis Leaf Extract</strong>, sebagai Natural Moisturizer</li>\r\n<li><strong>Witch Hazel distillate (Hamamelis virginiana)</strong>&nbsp;sebagai skin conditioning kulit dan pore minimizer agent.</li>\r\n<li><strong>Sodium hyaluronate</strong>&nbsp;sebagai Moisturizer Booster</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">Dapat disimpulkan bahwa manfaat Day Cream HNI HPAI sebagai berikut:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li>Cream yang digunakan untuk perawatan pada pagi / siang hari.</li>\r\n<li>Protective + Anti Aging + Moisturizing.</li>\r\n<li>Berfungsi sebagai protective yang melindungi kulit dari efek buruk sinar matahari dengan kandungan UV filter.</li>\r\n<li>Efek Moisturizing memberikan kelembaban yang cukup untuk kulit wajah sepanjang hari.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 style=\"text-align: justify;\"><strong>Cara Pemakaian Day Cream HNI HPAI</strong></h2>\r\n<p style=\"text-align: justify;\">Oleskan pada kulit wajah Day Cream HNI HPAI yang sudah bersih setiap pagi / siang hari secara teratur dan dapatkan manfaat yang luar biasa agar kulit menjadi mulus, sehat dan terawat. Padukan Day Cream HNI HPAI dengan Nigth Cream HNI HPAI pada malam harinya untuk mendapatkan hasil yang maksimal. Demikian aturan pakai Day Cream HNI HPAI yang bisa digunakan oleh siapa saja terkhusus wanita.</p>\r\n<p style=\"text-align: justify;\">Untuk pemesanan produk Day Cream HNI HPAI silahkan Anda bisa menghubungi kontak pesan yang tercantum di situs ini.</p>', 'Day Cream HNI HPAI Merawat dan Melindungi Kulit – Setiap wanita mendambakan kulitnya mulus dan sehat. Kebanyakan wanita akan merasa minder apabila pada kulit wajahnya timbul kerutan, flek hitam, dan terlihat kusam. Permasalahan kulit seperti demikian salah satunya diakibatkan kurangnya perawatan pada wajah dan tidak terlindungnya wajah dari paparan sinar matahari. Untuk itu salah satu solusi untuk merawat wajah agar sehat dan terjaga dari dampak sinar UV pada kulit adalah dengan menggunakan Day Cream.\r\n\r\nISI 15 Gram', 53, 75000, 0, 0, '1', '3', '1', 'Day Cream HNI HPAI Merawat dan Melindungi Kulit , Kebanyakan wanita akan merasa minder apabila pada kulit wajahnya timbul kerutan, flek hitam, dan terlihat kusam. ', 'day cream, night cream, herbal, HPAI, HNI, Cream Herbal, Dunia Halal', '14', 'prod-a1b8.jpg', 0, 15, '2019-05-14 10:45:40', 132);
